import { Header } from "./Header"
import { BrowserRouter as Router, Switch, Link } from "react-router-dom";
import "./styles.css";

const Main = () => {

  return (
    <>
      <Header titulo='Mis Tareas' />
      <Router>
        <Switch>
          <Link to='/agregar' className='btn btn-dark'>Agregar Tareas
          <main className="main bg-light">
            </main>
          </Link>
        </Switch>
      </ Router>
    </>
  );
};

export { Main };
